import axios from 'axios';

export function consumeApi() {
    return (dispatch) => {
        return axios.get(``)
            .then(response => {
                dispatch({
                    type: 'CONSUME_API',
                    payload: ''
                })
            })
            .catch(error => {
                throw (error);
            });
    }
}
